    mile inland waterway that includes 57 locks, which are used to transfer vessels
    from a navigation pool at one elevation to another. Information provided in this
    data set includes the name of each lock, its phone number and specific location
    by mileage along the canal and geographic coordinates. This dataset excludes the
    Utica Harbor Lock because at this time it is not open to the public.",nt"license_title":
